import { configureStore } from "@reduxjs/toolkit";
import rootReducer from "./reducers"; // Remplacez 'rootReducer' par votre rootReducer réel

const store = configureStore({
  reducer: {
    root: rootReducer,
  },
  devTools: true,
});

export default store;
